import React, {useState} from 'react';
import "../../../styles/Partials/_navBar.scss";
import Pikmin from "../../../assets/pikmin.gif"
import ConnectForm from "../Connect Form/index";


export default function NavBar() {
  const [isFormVisible, setFormVisible] = useState(false) 
  function contactFormPopUp(){
    setFormVisible(!isFormVisible)
  }

  return (
    <div>
        <nav>
            <ul>
                <li><a className="homelink" href="#home">Hanson</a></li>
                <li><a href="#about">About</a></li>
                <li><a href="#projects">Projects</a></li>
                <li><a className="connectlink" href="#contact" onClick={()=>{contactFormPopUp()}}>Connect</a></li>
            </ul>
        </nav> 
        <img className='pikimin' src={Pikmin}></img>
       {isFormVisible && <ConnectForm/>}
    </div>
  );

}
